import * as React from "react";
import { AppBar, Badge, Toolbar, Typography } from "@mui/material";
import { Mail, Search } from "@mui/icons-material";
import { Searchbox } from "./style/searchbar/Searchbox";
import { StyledInputBase } from "./style/searchbar/StyledInputBase";
import { SearchIconWrapper } from "./style/searchbar/SearchIconWrapper";
import { Iconbox } from "./style/iconbar/Iconbox";

const NavBar = () => {
    return (
        <AppBar>
            <Toolbar>
                <Typography variant="h6">
                    CSE Society
                </Typography>
                <Searchbox>
                    <SearchIconWrapper> 
                        <Search /> 
                    </SearchIconWrapper>

                    <StyledInputBase 
                    placeholder="Searchâ€¦" 
                    inputProps={
                        { 
                        'aria-label': 'search' 
                        }
                    } 
                />    
                </Searchbox>
                <Iconbox>
                <IconButton size="large" aria-label="show 4 new mails" color="inherit">

                </IconButton>
                    <Badge color="error" variant="dot" overlap="circular">
                        <Mail />
                    </Badge>
                </Iconbox>
            </Toolbar>
        </AppBar>
    );
};

export default NavBar;
